import React from 'react';
import ReactDOM from 'react-dom/client';
import Home from './Home/Home';
import About from './About/About';
import { BrowserRouter, Routes ,Route} from 'react-router-dom';
import Shop from './Shop/Shop';
import Hooks from './Hooks';
// import Carusel from './Carusel';
import Maping from './Maping';
// import Componant1 from './Componant1';
import Api from './Api';
import UseRef from './UseRef';
import SigninInsert from './SigninInsert';
import DeleteApi from './DeleteApi';
import LoginApi from './LoginApi';
import Update from './Update';
// import LoginInsertApi from './LoginInsertApi';
// import SigninInserApi from './signinInsertApi';
// import Mapping from './Mapping';
// import Mapping from './Mapping';


// import './index.css';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <BrowserRouter>
      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/shop" element={<Shop />} /> 
        <Route path="/signin" element={<SigninInsert />} /> 
        <Route path="/api" element={<Api/>} /> 
        <Route path="/delete" element={<DeleteApi/>} /> 
        <Route path="/" element={<LoginApi/>} /> 
        <Route path="/update/:id" element={<Update/>} /> 
        {/* <Route path="/api" element={<Api/>} />  */}


        {/* Add more routes as needed */}
      </Routes>
    </BrowserRouter>
    {/* <Carusel /> */}
    {/* <Hooks /> */}
    {/* <Maping/> */}
    {/* <Componant1/> */}
    {/* <UseRef/> */}
  </>


);

